import React from "react";

export default function ProfilePage() {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-semibold">My Profile</h2>
      <p className="mt-4 text-gray-600">(Your profile details will go here.)</p>
    </div>
  );
}
